import React, {useState} from "react";
import {Text,View,TextInput,StyleSheet,Button,Modal} from "react-native";

export default function Calculate ()
{
    const [modalT1,setModalT1] = useState(false);

    return(
        /* 5 окошек */
        <View>
    <View style = {styles.poles}>
    <Text> Q = </Text>
    <TextInput placeholder = 'Вводить Q'/>
    </View>
    <View style = {styles.poles}>
    <Text> m = </Text>
    <TextInput placeholder = 'Вводить m'/>
    </View>
    <View style = {styles.poles}>
    <Text> c = </Text>
    <TextInput placeholder = 'Вводить c'/>
    </View>
    <View>
        <Text>T кипения = </Text>
        <Text>T замера =  </Text>
    </View>
    <View style = {styles.poles}>
    <Text> T2 = </Text>
    <TextInput placeholder = 'Вводить T2'/>
    </View>
    <View style = {styles.poles}>
    <Text> T1 = </Text>
    <TextInput placeholder = 'Вводить T1'/>
    <Button title = 'Едц'/>
    <Modal visible = {modalT1}>
        <Text>Единица измереия T1</Text>
        <Button title = 'OK' onPress = {()=>setModalT1(false)}/>
    </Modal>
    </View>
</View>  
    )  
};
 const styles = StyleSheet.create(
     {
        poles:
        {
            color:'black',
            flexDirection:'row',
        },
     }
 )
